import { useState } from "react";
import axios from "axios";

const GetCandidate = () => {
  const candidteData = []
  axios({
    method: "get",
    url: "http://localhost:3001/get-candidate",
    responseType: "json",
  }).then((response) => {
    candidteData.push(response.data.data)
  });
  return candidteData;
};

export { GetCandidate };
